import './index.css';
import React, {Suspense} from 'react';
import {Canvas} from '@react-three/fiber'
import {PerspectiveCamera, useGLTF, useRef} from '@react-three/drei';
import { Environment } from '@react-three/drei'


function Model(props) {
  const { nodes } = useGLTF("/Untitled.gltf");
  return (
    <group {...props} dispose={null}>
      <PerspectiveCamera
        makeDefault={false}
        far={10000}
        near={10}
        fov={53.1}
        position={[-90, -90, 323.9]}
        rotation={[-0.1, 0, 0]}
      />
      <mesh
        geometry={nodes.Polygon.geometry}
        material={nodes.Polygon.material}
        position={[-10, -17.4, 0]}
      />
    </group>
  );
}

useGLTF.preload("/Untitled.gltf");




export default function App() {

  return (
    <div className="App">
      <Canvas size={[`1000px`,`2000px`]}
      style={{width: `100%`, height: `500px`, position: `relative`, alignitems: `center`}}>
        <Suspense fallback={null}>
          <Model scale ={[0.05,0.05,0.05]}/>
          <Environment preset="sunset" background />
        </Suspense>
      </Canvas>
    </div>
  )
}
